import React from "react";
import 'bootstrap/dist/css/bootstrap.css'; 
import { Container, Row, Col } from 'react-bootstrap';
import AvailableSpaces from "./AvailableSpaces";
import AddressBox from "./AddressBox";
import GraphComponent from "./GraphComponent";

const MainBoard = () => {
  return (  
    <Container 
      className="d-flex flex-column align-items-start justify-content-start"
      style={{ 
        backgroundColor: '#CBC3E3', 
        height: '70vh', // Adjust the height as needed
        width: '70vw', // Adjust the width as needed
        borderRadius: '20px 0 0 20px', // Optional: Add border-radius for rounded corners
        boxShadow: '0 0 10px rgba(0, 0, 0, 0.1)', // Optional: Add a box shadow
        marginTop: '4.5vh',
        marginRight: '0px'
      }} 
    > 
      <Row>
        <Col>
          {/* First Subcomponent - AvailableSpaces */}
          <AvailableSpaces />
        </Col>
        <Col>
          {/* Second Subcomponent - AddressBox */}
          <AddressBox />
        </Col>
      </Row>
      <Row>
        <Col>
          {/* Third Component - GraphComponent */}
          <GraphComponent />
        </Col>
      </Row>
    </Container> 
  ); 
}

export default MainBoard;
